package HackerRank;

import java.math.BigInteger;

public class BigIntegerSolution {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a=10000000;
		int b=20000000;
		BigInteger A,B;
		A=BigInteger.valueOf(a);
		B=BigInteger.valueOf(b);
		System.out.println(A.multiply(B));
		
	}

}
